  exec: cd remote-execution-client/tools/dep2yaml && cmake-remote-generator/build/bin/cmake
    -Sdevilutionx -Bremote-execution-client/tools/dep2yaml

rebuild_cache:
  deps: []
  exec: phony
  input:
  - CMakeFiles/rebuild_cache.util

CMakeFiles/edit_cache.util:
